import React from 'react'
import './Footer.css'
import Contacts from './Contacts/Contacts.jsx'

const Footer = () => {
	return (
		<footer className='footer'>
			<Contacts />
			<div className='copyright'>Мой силант 2024</div>
		</footer>
	)
}

export default Footer
